import { Text } from "domelementtype";
import { extend } from "lodash";
import React, { Component } from "react";
import TextBox from "/Users/kraken/Desktop/bulls/src/shared/Components/TextBox/TextBox.js";

class Register extends Component {
  render() {
    return (
      <div className="container mt-6">

        <div className="row justify-content-center">
          <div class="col-5 mt-3">
            <TextBox inputType="number" placeholder="Enter Mobile" label="Mobile Number"/>
          </div>
        </div>

        <div className="row justify-content-center">
          <div class="col-5 m">
            <TextBox inputType="password" placeholder="Enter Password" label="Password"/>
          </div>
        </div>

        <div className="row justify-content-center">
          <div class="col-5">
            <TextBox inputType="number" placeholder="Enter OTP" label="OTP"/>
          </div>
        </div>
      </div>
    );
  }
}

export default Register;
